import request from '@/utils/request';
export default {
  get: function get(id) {
    return request({
      url: '/user/address/' + id,
      method: 'get'
    });
  },
  changeDefault: function changeDefault(id, isDefault) {
    return request({
      url: '/user/address/' + id + '/' + isDefault,
      method: 'post'
    });
  },
  queryByUser: function queryByUser() {
    return request({
      url: '/user/address/queryByUser',
      method: 'get'
    });
  },
  save: function save(params) {
    return request({
      url: '/user/address/save',
      method: 'post',
      data: params
    });
  },
  remove: function remove(id) {
    return request({
      url: '/user/address/' + id,
      method: 'delete'
    });
  }
};
